<style>
* { box-sizing: border-box; margin: 0; padding: 0; }
body { 
  font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', sans-serif; 
  background: linear-gradient(135deg, #f8f6f0 0%, #e8e4d8 100%);
  min-height: 100vh;
  padding: 20px;
}
h1 { 
  text-align: center; 
  color: #2d5a3d; 
  margin-bottom: 10px;
  font-size: 2.5rem;
}
.subtitle {
  text-align: center;
  color: #666;
  margin-bottom: 30px;
  font-size: 1.1rem;
}
.grid { 
  display: grid; 
  grid-template-columns: repeat(auto-fit, minmax(280px, 1fr)); 
  gap: 24px; 
  max-width: 1600px; 
  margin: 0 auto; 
}
.card { 
  background: white; 
  border-radius: 16px; 
  overflow: hidden; 
  box-shadow: 0 8px 24px rgba(45,90,61,0.12);
  transition: transform 0.3s, box-shadow 0.3s;
}
.card:hover {
  transform: translateY(-4px);
  box-shadow: 0 12px 32px rgba(45,90,61,0.18);
}
.card h2 { 
  padding: 16px 20px; 
  background: linear-gradient(135deg, #2d5a3d 0%, #3d7a5d 100%);
  color: white; 
  font-size: 1rem;
  font-weight: 600;
}
.card img { 
  width: 100%; 
  height: auto; 
  display: block;
}
.phone { 
  max-width: 320px; 
  margin: 0 auto; 
}
.footer {
  text-align: center;
  margin-top: 40px;
  color: #888;
  font-size: 0.9rem;
}
.badge {
  display: inline-block;
  background: #2d5a3d;
  color: white;
  padding: 4px 12px;
  border-radius: 20px;
  font-size: 0.75rem;
  margin-left: 8px;
  vertical-align: middle;
}
</style>
</head>
